.container {
  width: 100%;
  height: 100%;
  --color: #E1E1E1;
  background-color: #F3F3F3;
  background-image: linear-gradient(0deg, transparent 24%, var(--color) 25%, var(--color) 26%, transparent 27%,transparent 74%, var(--color) 75%, var(--color) 76%, transparent 77%,transparent),
      linear-gradient(90deg, transparent 24%, var(--color) 25%, var(--color) 26%, transparent 27%,transparent 74%, var(--color) 75%, var(--color) 76%, transparent 77%,transparent);
  background-size: 55px 55px;
}

.button-go {
  cursor: pointer;
  position: relative;
  padding: 10px 24px;
  font-size: 18px;
  color: var(--brand-text);
  border: 2px solid var(--brand-button);
  border-radius: 34px;
  background-color: transparent;
  font-weight: 600;
  transition: all 0.3s cubic-bezier(0.23, 1, 0.320, 1);
  overflow: hidden;
}

.button-go::before {
  content: '';
  position: absolute;
  inset: 0;
  margin: auto;
  width: 50px;
  height: 50px;
  border-radius: inherit;
  scale: 0;
  z-index: -1;
  background-color: var(--brand-button);
  transition: all 0.6s cubic-bezier(0.23, 1, 0.320, 1);
}

.button-go:hover::before {
  scale: 3;
}

.button-go:hover {
  color:var(--brand-background);
  scale: 1.1;
  box-shadow: 0 0px 20px rgba(193, 163, 98,0.4);
}

.button-go:active {
  scale: 1;
}

.button-top {
  width: 50px;
  height: 50px;
  border-radius: 50%;
  background-color: rgb(20, 20, 20);
  border: none;
  font-weight: 600;
  display: flex;
  align-items: center;
  justify-content: center;
  box-shadow: 0px 0px 0px 4px rgba(180, 160, 255, 0.253);
  cursor: pointer;
  transition-duration: 0.3s;
  overflow: hidden;
  position: relative;
}

.svgIcon {
  width: 12px;
  transition-duration: 0.3s;
}

.svgIcon path {
  fill: white;
}

.button-top:hover {
  width: 140px;
  border-radius: 50px;
  transition-duration: 0.3s;
  background-color: var(--brand-button);
  align-items: center;
}

.button-top:hover .svgIcon {
  /* width: 20px; */
  transition-duration: 0.3s;
  transform: translateY(-200%);
}

.button-top::before {
  position: absolute;
  bottom: -20px;
  content: "Back to Top";
  color: white;
  /* transition-duration: .3s; */
  font-size: 0px;
}

.button-top:hover::before {
  font-size: 13px;
  opacity: 1;
  bottom: unset;
  /* transform: translateY(-30px); */
  transition-duration: 0.3s;
}

.work-button {
  position: relative;
  display: flex;
  align-items: center;
  gap: 4px;
  padding: 16px 36px;
  border: 4px solid;
  border-color: transparent;
  font-size: 16px;
  background-color: inherit;
  border-radius: 100px;
  font-weight: 600;
  color: inherit;
  box-shadow: 0 0 0 2px var(--brand-button);
  cursor: pointer;
  overflow: hidden;
  transition: all 0.6s cubic-bezier(0.23, 1, 0.32, 1);
}

.work-button svg {
  position: absolute;
  width: 24px;
  fill: var(--brand-button);
  z-index: 9;
  transition: all 0.8s cubic-bezier(0.23, 1, 0.32, 1);
}

.work-button .arr-1 {
  right: 16px;
}

.work-button .arr-2 {
  left: -25%;
}

.work-button .circle {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 20px;
  height: 20px;
  background-color: var(--brand-button);
  border-radius: 50%;
  opacity: 0;
  transition: all 0.8s cubic-bezier(0.23, 1, 0.32, 1);
}

.work-button .text {
  position: relative;
  z-index: 1;
  transform: translateX(-12px);
  transition: all 0.8s cubic-bezier(0.23, 1, 0.32, 1);
}

.work-button:hover {
  box-shadow: 0 0 0 12px transparent;
  color: var(--brand-background);
  border-radius: 12px;
}

.work-button:hover .arr-1 {
  right: -25%;
}

.work-button:hover .arr-2 {
  left: 16px;
}

.work-button:hover .text {
  transform: translateX(12px);
}

.work-button:hover svg {
  fill: var(--brand-background);
}

.work-button:active {
  scale: 0.95;
  box-shadow: 0 0 0 4px var(--brand-button);
}

.work-button:hover .circle {
  width: 220px;
  height: 220px;
  opacity: 1;
}

.Btn-whatsapp {
  display: flex;
  align-items: center;
  justify-content: flex-start;
  width: 75px;
  height: 75px;
  border: none;
  border-radius: 50%;
  cursor: pointer;
  /* --- Changes are here --- */
  position: fixed;     /* Position relative to the viewport */
  bottom: 20px;        /* 20px from the bottom */
  right: 20px;         /* 20px from the right */
  z-index: 1000;       /* Ensure it stays on top of other content */
  /* --- End of changes --- */
  overflow: hidden;
  transition-duration: 0.3s;
  box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.199);
  background-color: #00d757;
}

.sign {
  width: 100%;
  transition-duration: 0.3s;
  display: flex;
  align-items: center;
  justify-content: center;
}

.sign svg {
  width: 40px;
}

.sign svg path {
  fill: white;
}
.text {
  position: absolute;
  right: 0%;
  width: 0%;
  opacity: 0;
  color: white;
  font-size: 1.2em;
  font-weight: 600;
  transition-duration: 0.3s;
}

.Btn-whatsapp:hover {
  width: 200px;
  border-radius: 40px;
  transition-duration: 0.3s;
}

.Btn-whatsapp:hover .sign {
  width: 30%;
  transition-duration: 0.3s;
  padding-left: 20px;
}

.Btn-whatsapp:hover .text {
  opacity: 1;
  width: 70%;
  transition-duration: 0.3s;
  padding-right: 10px;
}
.Btn-whatsapp:active {
  transform: translate(2px, 2px);
}

