setupIntersectionObserver.handler:
const observers = globalThis[Symbol.for("toddle.intersection_observer.observers")] ??= new Map();

/**
 * @param {Args} args
 * @param {Ctx} ctx
 */
function setupIntersectionObserver (args, ctx) {
  const observer = new IntersectionObserver(entries => ctx.triggerActionEvent("callback", entries[0]), {
    root: args.rootElementId ? ctx.root.getElementById(args.rootElementId) : null,
    threshold: args.threshold ?? 1,
    rootMargin: args.rootMargin ?? '0px 0px 0px 0px'
  });
  observer.observe(args.target);

  // Clean up previous observer. Usually called when attributes are updated dynamically of the intersection observer component
  observers.get(args.target)?.disconnect();

  // Store new observer
  observers.set(args.target, observer)
  return () => {
    observer.disconnect();
    observers.delete(args.target)
  }
}
